【商品説明】<br>２年間保証付きのガス注入式スライド式ターボフレームライターです。ターボ炎なので風に強いので屋外の使用に最適です。ピンク・シルバー・ブルー・ブラックの４色あります。本体に花柄のシール巻きが特徴です。<br>使用方法用途など：<BR>着火ボタンをスライドさせて点火させます。炎の高さは、炎調整レバーで調整可能です。ガス注入口より、ガスライター専用ボンベでガスの補充が可能です。<br><br>成分：<BR>可燃性高圧ガス<br>使用上の注意：<BR>たばこの点火専用。顔、衣類から離して点火し、消火を確認する。残火・ガス漏れの原因となる異物混入のないことを確認する。５秒以上点火しない。ガス注入の際は、着火レバーを操作せず、机等から手を離して手に持って注入する。ガス注入後、使用まで５分間以上待つ（ボンベの注意書きに従うこと）。<br>保管保存方法：<BR>長時間の日光、５０度以上の高温を避けて保管してください。<br>保管および取扱い上の注意：<BR>子供に触れさせないよう注意して保管ください。<br>問い合わせ先：<BR>株式会社ライテック　サービスセンター　〒１１１－００５３　東京都台東区２－１３－９　ＴＥＬ０３（３８６１）７８６１　受付時間：月～金１０：００～１７：００（土日祝日を除く）<br>原産国：中華人民共和国<br>ブランド：チェリッシュ<BR>商品サイズ：20×84×11<br>JANコード：4977648113644<BR>cs：240<BR>商品カテゴリ： 喫煙具・着火用品　＞　着火用品　＞　着火用品　(660000)<BR><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
